                    border: 0 solid currentColor

                    width: 32px;
                    height: 32px

                    position: absolute;
                    top: 50%;
                    left: 50%;
                    width: 8px;
                    height: 8px;
                    margin-top: -4px;
                    margin-left: -4px;
                    border-radius: 100%;
                    -webkit-animation: ball-spin-clockwise 1s infinite ease-in-out;
                    -moz-animation: ball-spin-clockwise 1s infinite ease-in-out;

                    0%,
